import React from "react";
import axios from "axios";
import { useParams, NavLink } from "react-router-dom";

const Home = () => {

    return(
        <div>
            <div className="nav">
                <h3>Welcome!</h3>
                <span><NavLink to={'/home'} activeClassName="active">Home</NavLink> | <NavLink to={'/yourgames'}>Your Games</NavLink> | <NavLink to={'/addgame'}>Add New Game</NavLink></span>
                <hr className="hLine"/>
            </div>
        </div>
    )
}

export default Home;
